import { defineStore } from "pinia";
export const useBox = defineStore({
  id: 'box',
  state: () => {
    return {
      zIndex: 1
    }
  },
  actions: {
    getzIndex() {
      this.zIndex += 1
      return this.zIndex
    }
  }

})
